import React from "react";
import "./App.css";
import {useFormik} from "formik";

function App() {
  const formik = useFormik({
    initialValues: {
      fullName
    }
  })
  return (
    <div>
      <div className="main">
        <h1>Form</h1>
      </div>

      <div>
        <form>
          <label>Full Name:</label>
          <input id="fullName" type="text" name="fullName"></input>

          <label>Student Code:</label>
          <input id="stuName" type="text" name="stuName"></input>

          <label>Email ID:</label>
          <input id="emailId" type="text" name="emailId"></input>

          <label>City:</label>
          <input id="cityName" type="text" name="cityName"></input>

          <button type="submit">Add</button>
        </form>
      </div>
    </div>
  );
}

export default App;
